// Libs
import React from "react";
import PropTypes from "prop-types";
import classnames from "classnames";

export function Card({ children, className, disabled = false, onClick, ...otherProps }) {
    const cardClassName = classnames(
        "brain-o-box",
        "brain-o-paper",
        {
            "brain-o-actionable": !!onClick,
            "brain-o-paper--shadow": !!onClick,
            "brain-c-card--elevated": !!onClick,
        },
        "brain-c-card",
        className
    );

    return (
        <div className={cardClassName} disabled={disabled === true} {...otherProps}>
            {children}
        </div>
    );
}

Card.propTypes = {
    /**
     * Content of card
     */
    children: PropTypes.node,
    /**
     * Additional className for card
     */
    className: PropTypes.string,
    /**
     * If is disabled
     */
    disabled: PropTypes.bool,
    /**
     * Click handler
     */
    onClick: PropTypes.func,
};
